import React from "react";
import "./category.css";
import { useSelector, useDispatch } from "react-redux";
import { decrement, increment } from "../../redux/authorsSlice";
function Category() {
  const count = useSelector((state) => state.category.value);
  console.log("count");
  console.log(count);
  console.log("count");
  return <div className="category-wrapper">Hello Category</div>;
}

export default Category;
